import React, { Component }  from 'react';
import MUIDataTable from "mui-datatables";

const PatientsList = (props) => {
  const { patients, data } = this.props;
  const columns = ["Nombre", "Edad", "Email", "Activo"];

  let patientList = patients.map(patient => {
    // ahorita solo tenemos el birthDate del paciente, age se calcularia aqui, o tb podria venir desde el back
    const { firstName, lastName, mail, age } = patient;
    return (
      [`${firstName} ${lastName}`, mail]
    )
  });

  const options = {
    filterType: 'checkbox',
    rowsPerPage: 5,
    rowsPerPageOptions: [5,10,15],
    textLabels:{
      body: '' //estp pa q cuando esten fetcheando los mensajes, aparezca en blanco el table
    }
  };  

  return(
    <MUIDataTable
      title={"Pacientes"}
      data={patientList}
      columns={columns}
      options={options}
    />
  )
}

export default PatientsList;
